import{_ as e,o,a as r,X as i}from"./chunks/framework.BPPv2K3c.js";const c=JSON.parse('{"title":"2025年01-02月振り返り","description":"","frontmatter":{"layout":"post","title":"2025年01-02月振り返り","category":"diary","tags":["diary"],"head":[["link",{"rel":"canonical","href":"https://www.codingfeline.com/2025/03/01/01to02-wrapup/"}],["meta",{"property":"og:url","content":"https://www.codingfeline.com/2025/03/01/01to02-wrapup/"}],["meta",{"property":"og:title","content":"2025年01-02月振り返り"}],["meta",{"property":"twitter:card","content":"summary_large_image"}],["meta",{"property":"twitter:site","content":"@_yshrsmz"}],["meta",{"property":"twitter:creator","content":"@_yshrsmz"}],["meta",{"property":"og:image","content":"https://www.codingfeline.com/2025/03/01/01to02-wrapup/ogp.png"}]]},"headers":[],"relativePath":"2025/03/01/01to02-wrapup/index.md","filePath":"posts/2025/2025-03-01-01to02-wrapup.md","date":{"time":"2025-03-01","string":"March 1, 2025","year":"2025","month":"03","day":"01"}}'),t={name:"2025/03/01/01to02-wrapup/index.md"};function l(n,a,h,u,s,p){return o(),r("div",null,[...a[0]||(a[0]=[i('<p>2025の1月-2月を振り返るよ。<br> できれば続けていきたい</p><p><strong>目次</strong></p><nav class="table-of-contents"><ul><li><a href="#仕事">仕事</a></li><li><a href="#買った">買った</a><ul><li><a href="#ipad-air">iPad Air</a></li><li><a href="#mokibo-fusion-keyboard-universal">Mokibo Fusion Keyboard Universal</a></li><li><a href="#goforty-o51go">GoForty O51Go</a></li><li><a href="#keebio-iris-lm">Keebio Iris LM</a></li><li><a href="#goforty-o54gos">GoForty O54GoS</a></li></ul></li><li><a href="#観た">観た</a><ul><li><a href="#gquuuuuux">GQuuuuuuX</a></li><li><a href="#トワイライト・ウォーリアー">トワイライト・ウォーリアー</a></li><li><a href="#星街すいせい-武道館ライブ">星街すいせい 武道館ライブ</a></li><li><a href="#白上フブキ-1st-ライブ">白上フブキ 1st ライブ</a></li></ul></li><li><a href="#ゲームした">ゲームした</a><ul><li><a href="#マインクラフト">マインクラフト</a></li></ul></li><li><a href="#その他">その他</a><ul><li><a href="#久しぶりにラーメン食べた。">久しぶりにラーメン食べた。</a></li></ul></li></ul></nav><h2 id="仕事" tabindex="-1">仕事 <a class="header-anchor" href="#仕事" aria-label="Permalink to &quot;仕事&quot;">​</a></h2><p>とりあえず去年の頭からやっていたプロジェクトは一段落。</p><p>なんか色々新しいこと始まってずっと忙しい感はある。もうなんかずっと言ってるけど、仕事を委譲していかなきゃいけないが自分もコード書きたい、のバランスを保つのってむずいよね。しかし色々やりたいけど色々やると色々できなくなるので委譲は必要。</p><h2 id="買った" tabindex="-1">買った <a class="header-anchor" href="#買った" aria-label="Permalink to &quot;買った&quot;">​</a></h2><p>ちょっと年初から金銭感覚バグってた。反省はあまりしてない。</p><h3 id="ipad-air" tabindex="-1">iPad Air <a class="header-anchor" href="#ipad-air" aria-label="Permalink to &quot;iPad Air&quot;">​</a></h3><p>iPad mini6 がいい加減古いので買い替え。 最近持ち歩き読書端末は Galaxy Z Fold6 で用が足りてしまっているので、家でのメディア消費に振り切って大画面の端末にしてみた。Apple Pencil は一応買ったけど。</p><p>ステージマネージャー使えば、テレビも HDMI 接続で普通に外部ディスプレイとして認識してくれるし大変はかどる。しかし外付けキーボードやらポインティングデバイスが必須になるのはめんどい。ということで↓の購入につながった。</p><h3 id="mokibo-fusion-keyboard-universal" tabindex="-1">Mokibo Fusion Keyboard Universal <a class="header-anchor" href="#mokibo-fusion-keyboard-universal" aria-label="Permalink to &quot;Mokibo Fusion Keyboard Universal&quot;">​</a></h3><p>キーボードの表面がタッチパッドにもなるキーボード。iPad Air 用に購入。</p><p>実は初代 Mokibo は Kickstarter で支援していたので懐かしい(当時は支援して届いたものの全然使わなかった)。</p><h3 id="goforty-o51go" tabindex="-1">GoForty O51Go <a class="header-anchor" href="#goforty-o51go" aria-label="Permalink to &quot;GoForty O51Go&quot;">​</a></h3><p>ふとロープロファイルのキーボードが欲しくなってしまい、衝動買い。<br> 40% のキーボードってそれこそ自作キーボード流行り始め当初の Let&#39;s Split 以来なんだけど、思いの外使えている。やはり数字行ほしいなあと思うときはあるけど、結構覚えてるもんだしパスワード入力時とか間違えるとわからなくなるタイミングは Macbook 本体のキーボード使えばなんとかなるといえばなんとかなる。</p><p>デザインと言い打鍵感といい最高で、とても気に入っている。</p><h3 id="keebio-iris-lm" tabindex="-1">Keebio Iris LM <a class="header-anchor" href="#keebio-iris-lm" aria-label="Permalink to &quot;Keebio Iris LM&quot;">​</a></h3><p>O51Go 使っててやはり数字行ほしいなあ、と思っていろいろ探して購入。ロープロファイルじゃない Iris ははるか昔に組んだことがあるので懐かしい。<br> しかしこれはこれで難しい。数字行があるかわりに一番下の modifier row が左右それぞれ 4 キーしかない。modifier キーを基本左側しか使わない習慣に難があると言えばそれはそう。しかし数字行を得た代償に全体的に使いづらくなってしまった。ままならない。</p><h3 id="goforty-o54gos" tabindex="-1">GoForty O54GoS <a class="header-anchor" href="#goforty-o54gos" aria-label="Permalink to &quot;GoForty O54GoS&quot;">​</a></h3><p>O51Go の分割版みたいなやつ。<br> やはり肩のことを考えると分割の方がいいよなあということで最近はこれ。分割したら片側7列になり O51Go より3キー多いので、より使いやすい。</p><p>最近の QMK 系自作キーボードはソフトウェアの進歩が著しくて、わざわざファームウェアのコンパイル → フラッシュをしなくてもいいんだなあ、と感心した。私が自作キーボードに一番ハマってたのは Let&#39;s Split(2017) 〜 Lily58(2020) くらいの間だったので、隔世の感がある。両側更新しなくてもいいし(昔も片側だけでイケたかは試してない)。</p><h2 id="観た" tabindex="-1">観た <a class="header-anchor" href="#観た" aria-label="Permalink to &quot;観た&quot;">​</a></h2><h3 id="gquuuuuux" tabindex="-1">GQuuuuuuX <a class="header-anchor" href="#gquuuuuux" aria-label="Permalink to &quot;GQuuuuuuX&quot;">​</a></h3><p>公開初日の夜に観に行った。もうパンフもキットも変えないかなあ、と思ったら両方とも無事劇場で購入できた。</p><p>大変おもしろかったし、ネタバレ食らう前に早く観に行け！　みたいな SNS での盛り上がりはなんか楽しかった。実際ネタバレ食らうと楽しみが半減するタイプの作品だったし。</p><p>キットは HG とは思えないほど細かくて、今までのガンダムとのデザインの違いを感じた。ディテールの細かさはほんと RG レベルだった。</p><h3 id="トワイライト・ウォーリアー" tabindex="-1">トワイライト・ウォーリアー <a class="header-anchor" href="#トワイライト・ウォーリアー" aria-label="Permalink to &quot;トワイライト・ウォーリアー&quot;">​</a></h3><p>アクション映画として大変楽しめた。気功は最強。</p><h3 id="星街すいせい-武道館ライブ" tabindex="-1">星街すいせい 武道館ライブ <a class="header-anchor" href="#星街すいせい-武道館ライブ" aria-label="Permalink to &quot;星街すいせい 武道館ライブ&quot;">​</a></h3><p>ついに夢がかなったんだねえ、と感慨深い。<br> VTuber のライブ、開催された次の日には本人の振り返り配信あるのすごい。</p><h3 id="白上フブキ-1st-ライブ" tabindex="-1">白上フブキ 1st ライブ <a class="header-anchor" href="#白上フブキ-1st-ライブ" aria-label="Permalink to &quot;白上フブキ 1st ライブ&quot;">​</a></h3><p>エモくて泣いた。ホロメンへのメッセージもあるのはすごい彼女らしくてよかった。</p><h2 id="ゲームした" tabindex="-1">ゲームした <a class="header-anchor" href="#ゲームした" aria-label="Permalink to &quot;ゲームした&quot;">​</a></h2><h3 id="マインクラフト" tabindex="-1">マインクラフト <a class="header-anchor" href="#マインクラフト" aria-label="Permalink to &quot;マインクラフト&quot;">​</a></h3><p>n 回目のマイクラ挑戦で、今までで一番ハマってる。というか色々調べながらちゃんとやるの初めて。ひたすらブランチマイニングしつつようやくネザーにたどり着いた感じ。</p><h2 id="その他" tabindex="-1">その他 <a class="header-anchor" href="#その他" aria-label="Permalink to &quot;その他&quot;">​</a></h2><h3 id="久しぶりにラーメン食べた。" tabindex="-1">久しぶりにラーメン食べた。 <a class="header-anchor" href="#久しぶりにラーメン食べた。" aria-label="Permalink to &quot;久しぶりにラーメン食べた。&quot;">​</a></h3><p>遅延型アレルギーの検査で小麦の反応が出てたのでずっとラーメン断ちしてたけど、実に472日ぶりに食べた。やはり小麦の麺はうまい…。</p>',39)])])}const b=e(t,[["render",l]]);export{c as __pageData,b as default};
